import React from 'react';

function Home() {
  return (
    <div>
      <h1>Hello <span>I'm</span></h1>
      <h1>Zhang Yu-Cheng</h1>
      <span>a former accountant, and now a front end developer</span>
      <p>I graduated from National Chung Cheng University in Taiwan and majored in Finance. My first job started at PricewaterhouseCoopers / 普华永道中天会计师事务所（特殊普通合伙）
      </p>

    </div>
  );
}

export default Home;
